import React from 'react'
import { StyleSheet } from 'react-native'
import { MaterialCommunityIcons } from '@expo/vector-icons'
import { Button } from 'react-native-paper';
import { Linking, Dimensions, View } from 'react-native'; 

var width = Dimensions.get('window').width; //full width


export default function Navbar() {
  return (
    <View style={styles.test}>
    <Button onPress={() => Linking.openURL('/')}>
            <MaterialCommunityIcons style={styles.button} name="logout" size={24} color="white" />
    </Button>
     <TouchableHighlight style={styles.addButton}>
                    <View>
                        <Button title='+'
                            titleStyle={{
                                color: "white",
                                fontSize: 30,
                            }}
                            onPress={() => this.props.navigation.navigate('AddFilm', {
                                addMovie: movie => this.addMovie(movie)
                            })}
                            buttonStyle={styles.button} />
                    </View>
                </TouchableHighlight>
    </View>
   )
}

const styles = StyleSheet.create({
  button: {
   paddingVertical: 20,
   position: 'relative',
  },
  test: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'flex-end',
    width: width,
  }
})
